import React from "react";

export const CompanyProfiles = ({
  companyProfileValues,
  count,
  getCompanyProfiles,
  symbols,
}) => {
  return (
    <div>
      {companyProfileValues?.map((companyProfile, index) => (
        <div key={index} className="single">
          <span>name : {companyProfile.name}</span>
          <span>country : {companyProfile.country}</span>
          <span>currency : {companyProfile.currency}</span>
          <span>web url : {companyProfile.weburl}</span>
        </div>
      ))}
      {companyProfileValues.length < count && (
        <button
          onClick={() =>
            getCompanyProfiles(
              symbols,
              companyProfileValues.length + 1,
              companyProfileValues.length + 5
            )
          }
        >
          Get more
        </button>
      )}
    </div>
  );
};
